Mensagens da bíblia;;;

1 Coríntios 14:34-36

34 As mulheres estejam caladas nas igrejas, porque lhes não é permitido falar; mas estejam sujeitas, como também ordena a lei. 35 E, se querem aprender alguma coisa, interroguem em casa a seus próprios maridos; porque é indecente que as mulheres falem na igreja. 36 Porventura, saiu dentre vós a palavra de Deus? Ou veio ela somente para vós?

